/*
 * Convert bytes into largest possible unit.
 * Takes an precision argument that defaults to 2.
 * created for #TP 831416
 * @author: Richie
 * Usage:
 *   bytes | fileSize:precision
 * Example:
 *   {{ 1024 |  fileSize}}
 *   formats to: 1 KB
*/
let PsFileSizePipe = class PsFileSizePipe {
    constructor() {
        this.units = ['Bytes', 'KB', 'MB', 'GB', 'TB', 'PB'];
    }
    transform(bytes = 0, precision = 2) {
        if (isNaN(parseFloat(String(bytes))) || !isFinite(bytes)) {
            return '?';
        }
        let unit = 0;
        while (bytes >= 1024) {
            bytes /= 1024;
            unit++;
        }
        return Number(bytes).toFixed(+precision) + ' ' + this.units[unit];
    }
};
